scriptlet.script:
try {
	sql = "select USER_NAME from ENA_APPROVERS where LAB_ID = '" + labID + "'"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

var uidList = scriptletContext.get("uidList");
if(uid.trim() != "") {
	if(uidList != undefined) {
		uidList = uidList.concat(",",uid);	
	}
	else {
		uidList = uid;
	}
	scriptletContext.put("uidList",uidList);
}

var pr = scriptletContext.get("RS_Previous_Response");
var approverList = scriptletContext.get("approverList");
switch(pr) {
	case "more items":
		if(output.trim().length > 0) {
			if(approverList != undefined) {
				approverList = approverList.concat(",",output);
			}
			else {
				approverList = output;
			}
			scriptletContext.put("approverList",approverList);
		}
		scriptletResponse = "more";
	break;

	case "no more items":
		if(approverList != undefined) {
			scriptletResponse = "complete";
		}
		else {
			scriptletResponse = "no approver";
			scriptletContext.put("FailureMessage","No Approvers found for the program. Check ENA_APPROVERS table.")
		}
	break;

	case "failure":
		scriptletResponse = "no approver";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;

	case udefined:
		scriptletResponse = "no approver";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;
}
